        // for accepted date formatting used by d3.time.format()
        domainLabelFormat: null,

        // Formatting of the title displayed when hovering a subDomain cell
        subDomainTitleFormat: {
            empty: "{date}",
            filled: "{count} {name} {connector} {date}"
        },

